import { useEffect, useState } from "react";
import React from "react";

function App() {
   const [todos, setTodosList] = useState(null);
   const [isLoadingTodos, setLoadingTodos] = useState(false);
   const [isError, setIsError] = useState(false);
   useEffect(() => {
      setIsError(false);
      setLoadingTodos(true);
      fetch("https://jsonplaceholder.typicode.com/todos")
         .then((response) => {
            if (!response.ok) {
               throw new Error("Api response fail");
               setIsError(true);
            }
            return response.json();
         })
         .then((todos) => {
            setLoadingTodos(false);
            setTodosList(todos);
         })
         .catch((todos) => {
            setIsError(true);
            setLoadingTodos(false);
         });
   }, []);

   return (
      <div>
         {isError && <p>Have are problem in server</p>}
         {isLoadingTodos && <p>Download all todos list</p>}

         {todos && todos.map((todo) => <p key={todo.id}>{todo.title}</p>)}
      </div>
   );
}

export default App;
